class BreweryDetail extends React.Component {

    clicker() {

    }

    render(){

      let jsxhtml = (<div className="content" onClick={this.clicker.bind(this)}>
          row content
          {this.props.children}
        </div>);

      if (this.props.open) {
        jsxhtml = (<div className="content open" onClick={this.clicker.bind(this)}>
          row content
          {this.props.children}
        </div>);
      }

      return (
        <div>
        {jsxhtml}
          </div>
      )
    }
}
export default BreweryDetail;
